import React from 'react';

class Table extends React.Component {
    constructor(props) {
        super(props);
        this.state = 
        {
            prospects: {},
        }
        this.loadData = this.loadData.bind(this)
        this.loadData()
    }

 componentDidMount() {
     this.loadData ()
     fetch('/getProspectData')
     .then(res => res.json())
     .then((data) => {
        this.setState({
            prospects: data
        })
     })
     .catch((err) => {
        console.log(err)
      })
 }

render() { 
    return(
        <Table prospects={this.state.prospects}  />
    )
}
}

export default Table;
